import React from 'react';



const ImageLinkForm = () => {
    return (
        <div className="container">
            <p>{'This is a face detector to detect faces from your pictures. Please try it'}</p>
            <div>
                <input type='text'></input>
            </div>
        </div>
    );
}

export default ImageLinkForm;
